script: |
  super -f text -I q7192.spq | sort > q7192.out

inputs:
  - name: q7192.spq
    data: |
      SELECT + tab0.col1 * col1 + tab0.col0 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT ( NOT NULL NOT BETWEEN NULL AND col2 + - col1 ) AND NOT col2 <= col1;
  - name: tab0

outputs:
  - name: q7192.out
    data: |
